        return (
          <View style={styles.main_container}>
          <Text>grrt</Text>
          </View>
        )
      }
    }
    // create style to component
    const styles = StyleSheet.create({
      main_container: {
        flex: 1,
        marginTop: 60
      },
      container: {
        width:35
      },
      textinput: {
        height: 40,
        borderColor: '#000000',
        borderWidth: 1,
        width:350
      
      }
      });
    //Export to component so we can use it elsewhere in our project
    
    export default  Affichage;
